import React from 'react'
import { Card, Icon, Avatar } from 'antd'

const { Meta } = Card

export default function DogCard(
    {
        name,
        image,
        url,
        loading
    }
) {

    return (
        <Card
            loading={loading}
            hoverable
            style={{ width: 240, marginTop: "10px" }}
            cover={<img alt="example" src={image} style={{width: "100%", height: "50%"}}/>}
        >
            <Meta title={name} description={url} />
        </Card>
    )
}
